sys_variable_value.value:
(function execute(inputs, outputs) {
 var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid"]);
    pubSub.maptoOutputFromInput(inputs, outputs,["projectid"]);
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gc_pubsub_spoke.fetch_topics', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var topics = [];
    obj.forEach(function(topic) {
        topics.push({
            "name": topic.name,
            "label": topic.name
        });
    })
    outputs.topics = {
        "data": topics
    }
    outputs.topicslist = topics;
})(inputs, outputs);

